# dhcpd.conf
# quBSD 0net DHCP schema

# option definitions common to all supported networks.
default-lease-time 4;
max-lease-time 4;
option interface-mtu 1420;
option domain-name-servers 172.16.0.1;
log-facility local7;

# external interface subnet. No assignments
subnet 10.255.0.0 netmask 255.255.0.0 {
}

#########  DEFINE  ALL  SUBNETS  ##########

